import { useState, useEffect } from 'react'

const titleholders = [
  {
    division: '',
    division_weight: '',
    name: '',
    record: '',
    imageUrl:''
  },
  {
    name: 'Mojo Jojo',
    role: 'Supreme Leader',
    imageUrl:
      'https://www.pngkit.com/png/full/150-1502762_i-wanted-to-draw-a-super-quick-and.png',
  },
  {
    name: 'Mojo Jojo',
    role: 'All Around Dictator',
    imageUrl:
      'https://www.pngkit.com/png/full/150-1502762_i-wanted-to-draw-a-super-quick-and.png',
  },
  // More people...
]

export default function TitleHolders() {
  const [divisions, setDivisions] = useState([])


  //  GET DIVISIONS to map in form 
  useEffect(() => {
  const fetchDivisions = async () => {
    let res = await fetch("http://localhost:3000/divisions");
    let divisionData = await res.json();
    setDivisions(divisionData);
  };
    fetchDivisions();
  },[]);


  return (
    <>
    <div className="relative isolate overflow-hidden bg-gray-900 py-24 sm:py-32">
      <img 
        src="https://cdn.dribbble.com/users/1808107/screenshots/11460419/media/0631ec21d8c5b09e3c8d1a51154152ea.gif" 
        alt="" className="absolute inset-0 -z-10 h-full w-full object-cover object-right md:object-center" 
        />
        <div className="mx-auto max-w-7xl px-6 lg:px-8">
          <div className="mx-auto max-w-2xl lg:mx-0">
            <h2 className="text-4xl font-extrabold tracking-tight text-white sm:text-6xl">Titleholders</h2>
            <p className="mt-6 text-lg leading-8 text-gray-300">
              Stay tuned to see what's coming up!
            </p>
          </div>
        </div>
      </div>

<section class="bg-white dark:bg-gray-900">
        <div class="container px-6 py-10 mx-auto">
          <h1 class="text-2xl font-semibold text-gray-800 capitalize lg:text-3xl dark:text-white">From the blog</h1>

          <div class="mt-8 lg:-mx-6 lg:flex lg:items-center">
            <img 
              class="object-cover w-full lg:mx-6 lg:w-1/2 rounded-xl h-72 lg:h-96" 
              src="https://images.unsplash.com/photo-1590283603385-17ffb3a7f29f?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80"
              alt=""/>

            <div class="mt-6 lg:w-1/2 lg:mt-0 lg:mx-6 ">
                <p class="text-sm text-blue-500 uppercase">category</p>

                <a href="#" class="block mt-4 text-2xl font-semibold text-gray-800 hover:underline dark:text-white">
                    All the features you want to know
                </a>

                <p class="mt-3 text-sm text-gray-500 dark:text-gray-300 md:text-sm">
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Iure veritatis sint autem nesciunt,
                    laudantium quia tempore delect
                </p>

                <a href="#" class="inline-block mt-2 text-blue-500 underline hover:text-blue-400">Read more</a>

                <div class="flex items-center mt-6">
                    <img 
                      class="object-cover object-center w-10 h-10 rounded-full" 
                      src="https://images.unsplash.com/photo-1531590878845-12627191e687?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=764&q=80" 
                      alt="" />

                    <div class="mx-4">
                        <h1 class="text-sm text-gray-700 dark:text-gray-200">Amelia. Anderson</h1>
                        <p class="text-sm text-gray-500 dark:text-gray-400">Lead Developer</p>
                    </div>
                </div>
              </div>
            </div>
          </div>
        </section>

        {/* <div className="mt-6 grid grid-cols-1 gap-y-10 gap-x-6 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8">
          {fighters.map((fighter) => (
            <AthleteCard fighter={fighter} />
          ))}
        </div> */}
      {/* </div>
    </div> */}
    </>
  )
}
